import React from "react";
import useClient from "./service";
import List from "../../components/list";
import { Button, Typography, Box, Container } from "@mui/material";
import ClientAdd from "./main";

export default function Client() {
  const { handleOpen, open, handleClose, onChange, addClient } = useClient();
  const list = []; c

  return (
    <Box>
      <Container sx={{ display: "flex", alignItems: "center", margin: 0 }}>
        <Typography variant="h4" sx={{ fontWeight: 550, flexGrow: 1 }}>
          Clients
        </Typography>
        <Button
          sx={{
            backgroundColor: "#f44336",
            color: "white",
            textTransform: "none",
            padding: "8px 16px",
            borderRadius: "4px",
            "&:hover": {
              backgroundColor: "#d32f2f",
            },
          }}
          onClick={handleOpen}
        >
          New Client +
        </Button>
        <ClientAdd
          open={open}
          handleClose={handleClose}
          onChange={onChange}
          addClient={addClient}
        />
      </Container>
      <Container sx={{ marginTop: "100px" }}>
        <Typography variant="h5" sx={{ flexGrow: 1 }}>
          Clients List
        </Typography>
        <List list={list} />
      </Container>
    </Box>
  );
}
